import React from 'react'
import InputTag from './InputTag'
import MuiThemeProvider from 'material-ui/styles/MuiThemeProvider';
import AppBar from 'material-ui/AppBar';
import TextField from 'material-ui/TextField';

// import RaisedButton from 'material-ui/RaisedButton';
// import { Button, Form, Grid, Header, Image, Message, Segment, Input, Label } from 'semantic-ui-react'


class RecipientInfo extends React.Component {


  render(){
    const { getFormInputData, handleChange, mainState } = this.props
    const page1Inputs = getFormInputData().page1

    return (

        <React.Fragment>
          {page1Inputs.map(dataObj =>
            (<TextField
              hintText="Please type..."
              floatingLabelText={dataObj.label}
              onChange={handleChange}
              data-category={dataObj.category}
              defaultValue={mainState.dataObj.name?mainState.dataObj.name:null}
              name={dataObj.name}
            />
            )
          )}
        </React.Fragment>

    )
   }
  }


export default RecipientInfo
